Question:Develop a Python program that calculates the factorial of a number, using recursion and no functions.
Solution:Write a recursive function that calculates the factorial of a number, without using functions.

Solution:Write a recursive function that calculates the factorial of a number, without using functions. 

``` 
def factorial(n):
    if n == 0 || n == 1
        return 1;
    else
        return n * factorial(n-1);
```<|end_of_text|>

